import React from "react";
import Navigations from "./Navigations";
import Head from "next/head";

export default function Layout({ children, title }) {
 return (
  <div>
   <Head>
    <title>{title}</title>
   </Head>
      <Navigations />
      <main>{children}</main>
  </div>
 );
}
